import './App.scss';
import { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import add from './images/add.png';
import {
  Button, Container, Nav, Navbar, NavDropdown, Alert,
  Accordion, Card, Badge, Breadcrumb, ButtonGroup, ListGroup,
  Carousel, CloseButton, DropdownButton, Dropdown, Figure, Row, Col,
  Placeholder, ProgressBar, Spinner, Table, Tabs, Tab
} from 'react-bootstrap';
import OffcanvasReact from './Offcanvas/OffcanvasReact';
import CustomToggle from './CustomToggle/CustomToggle';
import ButtonLoading from './ButtonLoading/ButtonLoading';
import ModalReact from './Modal/Modal';

function App() {

  return (
    <div className="App">
      <Tabs
        defaultActiveKey="profile"
        id="uncontrolled-tab-example"
        className="mb-12"
        size="lg"
      >
        <Tab eventKey="home" title="Home">
          Tired with all these, for restful death I cry, As to behold desert a beggar born, And needy nothing trimm'd in jollity, And purest faith unhappily forsworn, And gilded honour shamefully misplac'd, And maiden virtue rudely strumpeted, And right perfection wrongfully disgrac'd, And strength by limping sway disabled And art made tongue-tied by authority, And folly--doctor-like--controlling skill,
        </Tab>
        <Tab eventKey="profile" title="Profile">
          As fast as thou shalt wane, so fast thou grow'st, In one of thine, from that which thou departest; And that fresh blood which youngly thou bestow'st, Thou mayst call thine when thou from youth convertest, Herein lives wisdom, beauty, and increase; Without this folly, age, and cold decay: If all were minded so, the times should cease And threescore year would make the world away. Let those whom nature hath not made for store, Harsh, featureless, and rude, barrenly perish:
        </Tab>
        <Tab eventKey="contact" title="Contact" disabled>
          123
        </Tab>
      </Tabs>
    </div>
  )
}

export default App;
